import Sidebar from '../Sidebar/Sidebar';
import MainContent from '../MainContent/MainContent';
const Dashboard = ()=> (
    <div className="app">
        <Sidebar/>
        <MainContent/>
        <style jsx>
            {`
                .app{
                    width: 100%;
                    height: 100vh;
                    display: flex;
                }

                .app > *{
                    height: inherit;
                }
            `}
        </style>
    </div>
);

export default Dashboard;
